<body>
		<div id="one">Here come real</div>
		<div id="two">stars to fill the upper skies,</div>
		<div id="three">And here on earth</div>
		<div id="four">come emulating flies,</div>
		<div id="five">That though they never</div>
		<div id="six">equal stars in size,</div>
		<div id="seven">(and they were never really</div>
		<div id="eight">stars at heart)</div>
		<div id="nine">Achieve at times a very</div>
		<div id="ten">star-like start.</div>
		<div id="eleven">Only, of course,</div>
		<div id="twelve">they can't sustain the part.</div>
